import React from 'react';
import styled from 'styled-components';

const imgBox = styled.div`
    width: 256px;
    height: 256px;
    border: 1px solid black;
`;

const ListItem = () => {
    return (
        <imgBox src={require("../kkobookchip.jpeg")}/>
    );
};

export default ListItem;
